    "You can use your {accountName} account to sign in to your {platformName} account.": "\u0f41\u0fb1\u0f7a\u0f51\u0f0b\u0f40\u0fb1\u0f72\u0f66\u0f0b {accountName} \u0f60\u0f51\u0f72\u0f0b\u0f66\u0fa4\u0fb1\u0f51\u0f0b\u0f53\u0f66\u0f0b{platformName} \u0f60\u0f51\u0f72\u0f60\u0f72\u0f0b\u0f53\u0f44\u0f0b\u0f53\u0f44\u0f0b\u0f60\u0f5b\u0f74\u0f63\u0f0b\u0f56\u0fb1\u0f0b\u0f46\u0f7c\u0f42",
